import React from 'react';
import './competences.css';
import html from '../assets/html.png'

const Competences = () => {


	return (
		<div className="comp">
			<h1>COMPETENCES</h1>
            <hr className="compHr"/>
            <div>
            <img class="fit-picture"
     src={html}
     alt="logo html" /> 
            </div>
        </div>
	);
};

export default Competences;
